// src/patient/PatientInterface.js
export const PatientInterface = {
  // Interface basique pour patient
  create: (data) => ({
    _id: data._id || '',
    username: data.username || '',
    email: data.email || '',
    phone: data.phone || '',
    dateNaissance: data.dateNaissance || '',
    sexe: data.sexe || ''
  })
};

export default PatientInterface;
